import {url}  from '../Utils/Links.js';

const loginEndpoint="login";

async function fetchLoginDetails(data)
{
    try
    {
        const response=await fetch(`${url}/${loginEndpoint}`,data,{method:"POST",headers:{'Content-Type':'application/json'},credentials:"include"})

        if(response.ok)
        {
            return response.json();
        }
        else
        {
            return false;
        }
    }
    catch(err)
    {
        throw err;
    }
}

export {fetchLoginDetails};
